import React from 'react'
import { logo } from '../assets'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <header className='w-full bg-green-200 px-4 py-4'>
        <Link to={'/'}>
        <img src={logo} alt="" className='w-24 object-cover'/>
        </Link>
    </header>
  )
}

export default Header
